import styled from "styled-components";

const TodoGrid = styled.section`
    display: grid;
    width: 100%;
    grid-template-columns: repeat(3, 1fr);
`

const TodoBox = styled.div`
    display: flex;
    justify-content: center;
`

function Todo () {

    return (
        <TodoGrid>
            <TodoBox>투두에오</TodoBox>
        </TodoGrid>
    )
}

export default Todo;
